// Creates Timer
void init_timer() {
  // Initializing the Timer
  *timer_p = 0;        // TO = 0
  *(timer_p + 1) = 0;  // RUN=0

  *(timer_p + 2) =
      TIMER_DELAY &
      0xFFFF;  // writing lower 16 bits of TIMER_DELAY to offset 8 of timer
  *(timer_p + 3) =
      (TIMER_DELAY >> 16) &
      0xFFFF;  // writing upper 16 bits of TIMER_DELAY to offset 12 of timer

  *(timer_p + 1) = 0b110;  // start = 1, cont = 1 to begin the timer (110 where
                           // cont is bit 1 and start is bit 2)
}

void display_timer_HEX(int timer) {
  char to_7seg[16] = {~0b1000000, ~0b1111001, ~0b0100100,
                      ~0b0110000, ~0b0011001, ~0b0010010,
                      ~0b0000010, ~0b1111000, ~0b0000000,
                      ~0b0011000, ~0b0001000, ~0b0000011,
                      ~0b1000110, ~0b0100001, ~0b0000110,
                      ~0b0001110};  // using char because 7 bits

  volatile int* hex_p = (int*)HEX4_ADDR;
  *hex_p = 0;  // turns off HEX5 and HEX4

  int hex_data = 0;  // data that will be written to HEX0, HEX1, HEX2, HEX3
  // hex_data = (d3 << 24) | (d2 << 16) | (d1 << 8) | d0;

  for (int i = 0; i < 4;
       i++) {  // saying 4 because 3600 (1 hour) is 4 digits big

    int val = timer % 10;
    val = to_7seg[val] & 0xFF;  // converts val to a seven-seg value// get rid
                                // of & 0xFF if you manually invert

    val = val << (i * 8);  // shifts the value to put it in the proper place in
                           // hex_data (line 64)
    hex_data = hex_data | val;  // the value is or'ed to put into correct place

    timer = timer / 10;
  }
  // at this point, hex_data is ready to be returned to hex display

  hex_p = (int*)HEX0_ADDR;
  *hex_p = hex_data;
}

void use_LEDs(int num_lives) {
  volatile int* led_p = (int*)LED_ADDR;
  if (num_lives == 1) {
    *led_p = 0x0001;
  } else if (num_lives == 2) {
    *led_p = 0x0003;
  } else if (num_lives == 3) {
    *led_p = 0x0007;
  } else {
    *led_p = 0x0000;
  }
}

// Extracts PS/2 pressed key using pointer to Address Map / port address
// Checks for read data valid before assigning make code for the pressed key
// to the int pointer variable given in input parameter
// Our game will require 2 different keys to implement jump and slide
// Make codes:
// S = 0x1B
// SPACE = 0x29
// L-ALT = 0x11
// ENTER = 0x5A
void read_ps2_keyboard(unsigned char* pressed_key) {
  volatile int* PS2_ptr = (int*)0xFF200100;  // PS/2 port address

  int PS2_data, R_VALID;

  PS2_data = *(PS2_ptr);          // read the Data register in the PS/2 port
  R_VALID = (PS2_data & 0x8000);  // mask bit-15 to check if read data valid

  // Only save PS2_data to *pressed_key if read data valid
  if (R_VALID != 0) {
    *(pressed_key) = (PS2_data & 0xFF);  // if valid, mask the 8-bit make code
  }

  // Empty the rest of the FIFO queue
  while (R_VALID != 0) {
    PS2_data = *(PS2_ptr);
    R_VALID = (PS2_data & 0x8000);
  }
}

// Polls timer device to see if TO; if yes then increment timer and call
// display_timer_HEX to update HEX display
void update_timer(int* timer) {
  if ((*timer_p & 1) == 1) {  // if timer expired (TO = 1)
    *timer_p = 0;             // TO = 0

    (*timer)++;

    display_timer_HEX(*timer);
  }
}

// Updates dino airborne parameters: y_loc_cur, airborne, rising
// Rising flag set to false upon reaching vertical jump max
// Airborne flag set to false upon landing on ground;
// rising flag reinitialized to true for next jump
void update_airborne_dino_params(struct Dino* trex) {
  // Update y_loc_cur
  if (trex->rising == true) {
    if (trex->y_loc_cur < JUMP_THR) {
      trex->y_loc_cur -= obstacle_speed;
    } else {
      trex->y_loc_cur -= 2 * obstacle_speed;
    }

  } else if (trex->rising == false) {
    if (trex->y_loc_cur < JUMP_THR) {
      trex->y_loc_cur += obstacle_speed;
    } else {
      trex->y_loc_cur += obstacle_speed;
    }
  }

  // Set rising to false after reaching max height
  if (trex->y_loc_cur <= JUMP_MIN) {
    trex->rising = false;
  }

  // Set airborne to false after landing on ground
  // Set rising to true to initialize the next jump
  else if (trex->y_loc_cur + trex->height >= Y_WORLD) {
    trex->airborne = false;
    trex->rising = true;
  }
}

// Updates dino low parameters: y_loc_cur, low
// Low flag set to false after elapsed time threshold (3 seconds)
void update_low_dino_params(struct Dino* trex, int* prevTime, int* currTime) {
  // If enough time has passed, then set low flag to false
  if (*currTime - *prevTime >= 3) {
    trex->low = false;
  }

  // Update y_loc_cur
  if (trex->low == true) {
    trex->y_loc_cur = Y_WORLD - 50;
    trex->height = 50;
  } else if (trex->low == false) {
    trex->y_loc_cur = Y_WORLD - 80;
    trex->height = 80;
  }
}

// Input Obstacle struct, Dino struct, num_lives int by pointer
// Checks and sets collision flag for cactus Obstacle
void check_cactus_collision(struct Obstacle* cactus, struct Dino* trex,
                            int* lives) {
  // Check if cactus x-bound corners are within trex range
  // And check if cactus y-bound top collides with trex bottom
  if ((cactus->x_loc_cur + cactus->width >= trex->x_loc_cur &&
       cactus->x_loc_cur <= trex->x_loc_cur + trex->width) &&
      (cactus->y_loc_cur <= trex->y_loc_cur + trex->height)) {
    // If not previously collided, then decrement num_lives
    if (cactus->collision == false) {
      (*lives)--;
    }
    // Set collision flag to true
    cactus->collision = true;
    use_LEDs(*lives);
  }
}

// Input Obstacle struct, Dino struct, num_lives int by pointer
// Checks and sets collision flag for cactus Obstacle
void check_pterodactyl_collision(struct Obstacle* pterodactyl,
                                 struct Dino* trex, int* lives) {
  // Check if pterodactyl x-bound corners are within trex range
  // And check if pterodactyl y-bound bottom collides with trex top
  if ((pterodactyl->x_loc_cur + pterodactyl->width >= trex->x_loc_cur &&
       pterodactyl->x_loc_cur <= trex->x_loc_cur + trex->width) &&
      (pterodactyl->y_loc_cur + pterodactyl->height >= trex->y_loc_cur)) {
    // If not previously collided, then decrement num_lives
    if (pterodactyl->collision == false) {
      (*lives)--;
    }
    // Set collision flag to true
    pterodactyl->collision = true;
    use_LEDs(*lives);
  }
}

