// Re-initializes all parameters to recycle input obstacle for endless queue
void recycle_obstacle(struct Obstacle* obs) {
  obs->collision = false;
  obs->erase = false;
  obs->go = false;

  int randNum = rand() % 4;

  if (randNum == 0 || randNum == 1) {
    // 50% chance cactus
    obs->cactus_obs_type = true;
    obs->height = 50;
    obs->width = 20;
    obs->x_loc_prev = 0;
    obs->y_loc_prev = 0;
    obs->x_loc_cur = X_MAX + 1;
    obs->y_loc_cur = Y_WORLD - 50;
  } else if (randNum == 2) {
    // 25% chance high pterodactyl
    obs->cactus_obs_type = false;
    obs->height = 20;
    obs->width = 26;
    obs->x_loc_prev = 0;
    obs->y_loc_prev = 0;
    obs->x_loc_cur = X_MAX + 1;
    obs->y_loc_cur = 90;
  } else if (randNum == 3) {
    // 25% chance low pterodactyl
    obs->cactus_obs_type = false;
    obs->height = 20;
    obs->width = 26;
    obs->x_loc_prev = 0;
    obs->y_loc_prev = 0;
    obs->x_loc_cur = X_MAX + 1;
    obs->y_loc_cur = Y_WORLD - 85;
  }
}

